import React from 'react';
import {useParams} from 'react-router-dom';

class Movie extends React.Component {
  constructor(props) {
    super(props);
  }

  componentDidMount () {
    console.log(this.props);
  }

  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col-12">
            Movie page
          </div>
        </div>
      </div>
    )
  }
}

function Something() {
  let {id} = useParams();
  console.log(id);
}

Something;

export default Movie;
